import React from "react";
import "./Card.css";
import { NavLink } from "react-router-dom";
const Card = props => {
  return (
    <NavLink to={props.link}>
      <div className="card" style={{ width: "16rem", margin: "0 5em 0 5em" }}>
        <img
          src={props.image}
          className="card-img-top"
          alt="shabuMenu"
          style={{ height: "197px", transition: "transform .2s" }}
        ></img>
        <div className="card-body">
          <p
            className="card-text"
            style={{
              fontSize: "1.5rem",
              textAlign: "center"
            }}
          >
            {props.text}
          </p>
        </div>
      </div>
    </NavLink>
  );
};
export default Card;
